description:
Mother Lovers Society 7: When gorgeous Sapphic romance writer, Juli Ann moves in to the neighborhood with her sexy assistant Chastity, the neighbors are all suspicious. Young Jessie is immediately intrigued by the older woman and younger girl relationship, while her mother Zoe is outwardly appalled. But Zoe has been discovering her own lesbian tendencies through Julia`s books. Will she give in to her daughter`s friend, Eva? Will Jessie get between Julia and Chastity? Melissa Monet makes her directorial debut for Sweetheart with this erotic tale of feminine discovery.

